import datetime
import pytest

from operator import itemgetter
from itertools import groupby


def create_cycle(seed_data, run, data):
    return seed_data.add_cycle(
        commit=False,
        run=run,
        number=data[1],
        runtime=data[2],
        end_of_cycle=datetime.datetime.fromisoformat(data[3]),
        r=data[4],
        g1=data[5],
        g2=data[6],
        ana=data[7],
        a=data[8],
        b=data[9],
        c=data[10],
    )


@pytest.fixture(scope='function')
def real_run(orm, seed_data):
    cycles = [
        create_cycle(seed_data, seed_data.run, d)
        for d in _data
        if d[0] == 20
    ]

    orm.commit()

    yield cycles

    for cycle in cycles:
        seed_data.delete(cycle, commit=False)
    orm.commit()


